-- Listage des données de la table nanar.film : ~9 rows (environ)
/*!40000 ALTER TABLE `film` DISABLE KEYS */;
INSERT INTO `film` (`id`, `title`, `poster`, `trailer`, `categories`, `id_vote`, `description`) VALUES
	(1, 'DOUBLE ZÉRO', _binary , 'https://player.allocine.fr/18364067.html', 'Comédie', 4, 'Un missile vient d\'être dérobé et la DGSE est sur les dents. Ses dirigeants pensent qu\'il y a un traître dans la maison. Pour récupérer l\'arme nucléaire, ils engagent en qualité de nouveaux James Bond deux losers accros aux jeux vidéos. Will et Ben serviront de couverture aux vrais espions. Mais si Will et Ben n\'étaient pas si chèvre ?\r\nDe Paris à la Jamaïque, se sentant investis de lourdes responsabilités, ils affrontent la sublime Natty Dreads et son armée de top models pour remonter jusqu\'à leur chef mégalomane : Le Mâle.'),
	(2, 'Star Wars Holiday Special', _binary , 'https://www.youtube.com/embed/F3-Df7ROAxA', 'Fantastique', 1, 'Suivez la suite des péripéties de Luke Skywalker, Han Solo, la princesse Leia et tout les autres dans une aventure située entre les épisodes IV et V. Cette fois, nos héros se rendent sur Kashyyyk, la planète natale de Chewbacca. En chemin, ils croiseront les agents de l\'empire....'),
	(9, 'EH MEC, ELLE EST OÙ MA CAISSE ?', _binary , 'https://www.allocine.fr/film/fichefilm_gen_cfilm=29342.html', 'Comédie', 4, 'Jesse et Chester, deux fêtards d\'une vingtaine d\'années, ont passé une nuit incroyable. Malheureusement, à leur réveil, ils ne se rappellent plus de rien, y compris de l\'endroit où ils ont garé leur voiture. Or, celle-ci contenait les précieux cadeaux d\'anniversaire qu\'ils avaient achetés pour leurs petites amies jumelles, Wanda et Wilma.'),
	(10, '2019, Après la Chute de New York', _binary , 'https://www.youtube.com/watch?v=rNPCKQJOuSo&ab_channel=OttoRivers', 'Action', 5, '« 2019 après la chute de New York », de Sergio Martino, est sans doute l’un des films les plus marquants du genre « post-apocalyptique » qui fit fureur dans des années 1980 encore perturbées par la peur de la guerre nucléaire. Réalisé par Sergio Martino, vétéran du cinéma bis italien qui ne s’était pas toujours distingué par une imagination délirante'),
	(11, 'Slap Her... She\'s French', _binary , 'https://www.youtube.com/watch?v=Squuvap57JE&ab_channel=MovieclipsClassicTrailers', 'Comédie', 5, 'Littéralement, "fous-lui une baffe, elle est française", "Slap Her, She\'s French" est le genre de film qui a bien choisi son moment pour sortir. Toutefois, avant de crier au Bushisme primaire, de manifester contre la guerre d\'Irak, d\'aller vider ses poubelles devant l\'ambassade des Etats-Unis, de carboniser une effigie de Ronald McDonald en place publique, de se tuer le bide au Mecca-Cola en signe de protestation et de brûler des cierges pour l\'accession à la Maison-Blanche du président américain le plus francophile de tous les temps,');
INSERT INTO `film` (`id`, `title`, `poster`, `trailer`, `categories`, `id_vote`, `description`) VALUES
	(12, 'Sex Trip', _binary , 'https://www.allocine.fr/film/fichefilm_gen_cfilm=55337.html', 'Comédie', 5, 'Petite perle arrivée tardivement en France, "Sex Trip" ("Eurotrip" en VO) relève d\'une catégorie bien particulière de films "comiques", ceux dont le ressort drôlatique repose sur la confrontation entre plusieurs cultures différentes. Traité avec respect et intelligence, ce genre de concept peut aboutir à un résultat réellement drôle, voire grinçant, comme "Les Dieux sont tombés sur la tête" ou "Les Chinois à Paris" du regretté Jean Yanne.'),
	(13, 'Teen Wolf Too', _binary , 'https://www.youtube.com/watch?v=96LR5Vsag_E&ab_channel=ScreamFactoryTV', 'Comédie', 5, 'A la vue de Teen Wolf premier du nom, la moindre des choses que l’on puisse penser ou dire (ou hurler dans tout Hollywood comme j’aurais voulu le faire à l’époque), c’est qu’un second opus ne s’imposait vraiment pas putain de bordel de merde. Mais proférer un tel jugement lapidaire (et grossier qui plus est)'),
	(21, 'Delta Force Commando', _binary , 'https://www.youtube.com/watch?v=GoxnWIATSmE', 'Action', 5, '"Delta Force Commando" est un petit classique du nanar d\'action bourrin à l\'italienne, et contribue à démontrer que l\'industrie du cinéma bis transalpine avait "un truc en plus" et que c\'est bien dommage que les bisseries made in Cineccità aient été irrévocablement supplantées par les produits certifiés 100% Américain. Car s\'il y avait une justice,'),
	(22, 'Demonicus', _binary , 'https://www.youtube.com/watch?v=lJKkRy9Z7mg&ab_channel=MulticomEntertainment', 'Horreur', 5, 'Été 2001, dans les montagnes italiennes. Une bande de jeunes Américains et leur professeur partent faire un trek dans les Alpes. Ils l’ignorent encore, mais cette randonnée sera bientôt mortelle.');
